Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F004017000163','F','004','017','F004017000163','다람쥐똥커피 아라비카',1000,17000,'베트남','Truong Son ','250g',50,'베트남 최대 커피농경지인 Da Lat지방에서 생산하는 커피로 다람쥐들이 붉게 잘 익은 커피체리를 먹는 모습을 보고 최고의 맛과 향을 가진 커피를 수확한 것입니다. 베트남 관광객들 사이에 일명 다람쥐똥커피로 알려져 있으며 귀국 선물로 많이 쓰이는 제품입니다.  ',1,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
