Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F004015000166','F','004','015','F004015000166','키커피 프리미엄 블랜드',8500,12820,'일본','KEY COFFEE INC','100g',50,'키커피 프리미엄 블랜드는 스트레이트 커피로, 하나의 원산지 원두만을 사용하였습니다. 쓴맛과 고급스런 신맛이 조화를 이루며 뒷맛이 깔끔한 최고품질의 커피입니다. 사용하기에 편하며 세련된 패키지가 커피애호가들에게 꾸준히 사랑을 받고 있습니다. ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
