Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F004015000169','F','004','015','F004015000169','브라질 카페 이과수 인스턴트커피',3500,5500,'브라질','브라질이과수사','100g',50,'첨과물이 전혀 없이 100% 원두로 만든 인스턴트 커피입니다. 동양인의 맛에 맞추어 제조했기 때문에 맛이 아주 부드럽고 순하며 한국인이 마시기에 적합합니다. ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
