Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F004020000172','F','004','020','F004020000172','트와이닝 얼그레이 홍차',4000,7300,'영국','TWINING AND COMPANY','50g (25개)',50,'실론산 홍차와 인도산 홍차를 브랜딩한 홍차로, 베르가못 나무 향이 들어있어 독특한 향이 일품이며, 우유나 설탕을 곁들이지 않고 즐기기 좋은 향첨가 홍차입니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
