Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003014000140','F','003','014','F003014000140','토모에 이나카 미소 (백된장)',4000,4460,'일본','FUKUYAMA CO LTD','500g',50,'홋카이도 다이세쓰잔 복류수와 대두, 쌀, 세계 자연유산으로 지정된 시레토코 해양 심？수를 사용한 소금으로 만든 백된장이며 부드럽고 자극성이 없는 깔끔한 일본 전통 된장입니다. 공기에 의한 산화변색을 방지하기 위해 개봉 후에는 뚜껑을 잘 닫아 냉장보관하시기 바랍니다.(냉동 보관시 냉동용 용기에 담아 보관)  ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
