Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003014000143','F','003','014','F003014000143','신주일미 아와세 적된장',3000,5030,'일본','MIYASAKA BREWERY ','1kg',50,'일본 신주일미 아와세 전된장은 된장의 주 원료인 쌀과 보리를 주로 사용하는데, 콩과 북해도산 다시마, 양질의 가다랑어를 배합하여 부드럽고 구수하면서도 부드럽게 잘 풀립니다.  일본된장을 처음 접하시는 분들께 추천하는 제품입니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
