Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F005021000184','F','005','021','F005021000184','라코스테냐 딸기잼',1500,3330,'멕시쿠','CONSERVAS LA COSTENA','270g',50,'신선한 딸기의 함량이 40%이며 딸기 윽유의 새콤한 맛이 그대로 살아있도록 설계된 잼입니다.  팥빙수, 팬케？, 아이스크림에 토핑으로 사용하기에 좋습니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
