Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F006027000203','F','006','027','F006027000203','맨스 라이프 포스',35000,44900,'USA','Source Naturals','180알',50,'솔스네추럴사의 인기 종합비타민 라이프 포스 제품을 기본으로 남성에게 필요한 성분을 추가하여 제작된 제품입니다. 남성들에 필요한 모든 성분을 함휴한 제품으로 신진대사, 에너지, 간장보호, 혈액순환, 항산화, 면역기능강화등이 한 제품으로 여러가지 효과를 볼 수 있는 최적의 제품으로 미국의 많은 전문의들이 추천하는 제품입니다. 1일 3~6정 식사와 함계 섭취하세요',1,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
