Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F002009000102','F','002','009','F002009000102','그린드림 블루베리 다크초콜릿',5000,6000,'벨기에','KLINGELE CHOCOLADE','55g',50,'블루베리와 코코아 함량 72%인 초콜릿으로 공정거래 무역 제품인 유기농 블루베리 다크 초콜릿입니다. 블루베리의 새콤함이 진한 초콜릿향과 어울려 감각적이면서도 즐거움을 주는 끝 맛이 특징입니다.',4,'admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F002009000103','F','002','009','F002009000103','화이트커버춰 초콜릿(홈베이킹용)',4700,4510,'독일','루드비히바인리히사','200g',50,'일반 초콜릿이면서 홈베이킹용이기도 한 이 화이트 초콜릿은 8칸으로 나우어져 있어 자르기 쉽고 사용하기에 편리합니다.또 화이트 초롯릿은 다른 초콜릿에 비래 녹는 온도가 조금 낮습니다.',0,'admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003011000104','F','003','011','F003011000104','게랑드 토판천일염 가는 소금(원통)',4500,5510,'프랑스','Ste BOURDIC','250g',50,'프랑스 게랑드 지방의 ？은 토판 천일염을 말린 후 곱게 빻은 가는 소금 입니다.입자가 고와서 미용, 목욕, 세안, 구강, 사우나 스크럽에 사용하셔도 좋습니다.',1,'admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003011000107','F','003','011','F003011000107','게랑드 마늘파슬리 소금',8800,9310,'프랑스','Ste BOURDIC','250g',5,'프랑스 게랑드 지방의 토판 천일염(92.5%)에 말린 마늘3.5%, 파슬리를 말려 곱게 빻아 혼합한 마늘 파슬리 소금입니다.천연 재료를 사용하여 개봉 후 장기간 보관하여도 굳거나 눅눅해 지지않고, 맛과 향이 오래 보존 됩니다. ',1,'admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003011000108','F','003','011','F003011000108','게랑드 허브소금',8800,9310,'프랑스','Ste BOURDIC','250g',50,'프랑스 게랑드 지방의 토판 천일염93%에 양파와 베이등 각종 허브를 말려 곱게 빻아 혼합한 허브소금입니다.',0,'admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/01','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003012000112','F','003','012','F003012000112','라코 월계수잎',1000,1710,'터키','LACO','20g',50,'월계수 잎은 달고 당한 독특？ 향기가 있어서 서양요리에는 필수적일 만큼 널리 쓰이는 향신료입니다. 보존용 식품(절임류 등)에 월계수가 이용되는 것은 향과 함계 상하지 않게 하며 강한 향이 나므로 처음에는 조금씩 사용하는 것이 좋습니다. ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003012000113','F','003','012','F003012000113','라코 바질',1000,1710,'이집트','LACO','20g',50,'바질은 천연향신료로 토마토 요리에서는 필수고 들어가는 향신료입니다. 엷은 신맛을 내며 달콤하고 강한 향을 즐기실 수 있습니다. 스파게티,피자,샐러드,드레싱, 특히 토마토요리에 필수적인 향신료입니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003012000114','F','003','012','F003012000114','라코 오레가노',1000,1710,'터키','LACO','20g',50,'오레가노는 이탈리아 요리의 대표적인 향신료로 박하같이 톡 쏘는 향기와 상쾌한 맛을 선사해줍니다. 토마토소스, 치즈, 생선, 육류등의 요리와 잘 어울립니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003012000115','F','003','012','F003012000115','로즈마리',2700,3510,'벨기에','ISFI','20g',50,'가볍고 달콤한 향이 나며, 살균소독 작용이 있어 육류를 보존할 때 이용합니다. 스튜,스프, 치즈요리에 세이지와 함께 넣으면 맛이있스니다. 잎은 장시간 조리해도 향이 없어지지 않습니다. ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003012000116','F','003','012','F003012000116','파슬리',1000,1710,'프랑스','LACO','20g',50,'파슬리는 다른 향신료나 조미료의 향을 없애는데 또는 혼합 허브나 조미료를 만들때 자주 쓰입니다. 특히 샐러드, 스프, 파스타, 버터, 조개류, 육류, 가금류의 요리에 풍미와 양식풍의 요리, 생선회, 일식요리등에 장식 효과를 줍니다. ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','N');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003012000117','F','003','012','F003012000117','계피가루(시나몬 가루)',3200,3610,'벨기에','ISFI','40g',50,'톡 쏘면서도 향긋한 냄새가 상쾌함, 청량감, 달콤함을  선사해줍니다. ',1,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003011000128','F','003','011','F003011000128','다크머스코바도',5000,5700,'영국','Silver Spoon Company','500g',50,'다크 머스코바도 흑설탕은 곱고 어두운 소프트 브라운 설탕입니다. 최소한의 가공공정거쳐 다량의 미네랄과 비타민등 미량원소가 풍부한 설탕입니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003011000129','F','003','011','F003011000129','라이트 머스코바도 흑설탕',5000,5700,'영국','Silver Spoon Company','500g',50,'라이트 머스코바도 흑설탕은 따뜻한 허니색과 크림 초콜릿향을 갖고 있는 가장 곱고 밝은 갈색 소프트 설탕입니다. 케익, 비스킷, 토프소스 짭짤한 소스, 과일쥬스, 쨈등에 잘 어울리는 설탕입니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003011000130','F','003','011','F003011000130','몰라시스 흑설탕',5000,5700,'영국','Silver Spoon Company','500g',50,'몰라시스 흑설탕은 가장 소프트한 브라운 슈가로 사탕수수 당밀로 가득 차있습니다. 진한 초코케익에 잘어울리며 구운 고기양념, 바베큐, 매실엑기스, 수정과등에 사용하면 좋습니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F003011000132','F','003','011','F003011000132','자이로과당',2300,3130,'필란드','DANSCO SWEETENERS ','250g',50,'천연의 달콤함이 살아있는 자이로과당입니다. 설탕에 민감한 분을 위한 감미료로 칼로리나 체중을 생각하는 분을 위한 디저트, 어린이 영양간식을 위한 콘프레이크에 사용하시면 좋습니다. ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
