Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000289','E','010','039','E010039000302','라베라 루스 미네랄 파우더 ',10000,17600,'독일','lavera','55g',50,'미세한 입자의 미네랄 파우더로 깔끔한 피부표현을 도와줍니다. 유기농 원요와 고효능의 미네랄이 함유되어 자연스러운 아름다움을 선사합니다. 모공을 막지 않으면서 깔끔한 메이크업 마무리를 도와주는 식물성 루즈파우더로 모든 피부타입에 사용 가능합니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000290','E','010','039','E010039000304','베네코스 컴팩트 파우더 포셀란 1St(Nr.1)',5000,7500,'독일','베네코스','50g',50,'크리미한 메이크업 마지막 단계에 발라주세요. 피부를 한 층 매끄럽게 보이게 합니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000291','E','010','039','E010039000303','베네코스 내츄럴 미네랄 파우더 라이트 샌드',4900,7200,'독일','베네코스','10g',50,'본 제품은 천연 미네랄 파우더로 무 탈크 제품입니다. 내츄럴한 커버로 맑고 투명하게 연출해줍니다. BDIH 인증을 받은 천연 화장품 제품입니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000292','E','010','039','E010039000298','베네코스 내츄럴 립글로즈',4000,6900,'독일','베네코스','30g',50,'은은한 과일 향과 맛으로 끈적이지 않게, 입술에 영양을 공급해 주고 섬세한 장미빛 색감으로 입술을 촉촉해져 빛나게 해 줍니다. 천연 화장품 BDIH 인증을 받은 제품입니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010040000293','E','010','039','E010039000307','로고나 립글로즈 레드베리(No.1), 테라코다(No.6)',8000,13900,'독일','로고나','18g',50,'식물성 오일과 왁스, 천연색소로 만든 천연 립글로즈로 화장을 오래 지속시켜 주고 깔끔하고 반짝이는 입술로 연출하며 자극없이 보호해줍니다. 아름다운 내츄럴 컬러로서 천연의 아름다운 멋을 내실 수 있습니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007029000313','E','007','029','E007029000313','산테 패밀리 파인애플&레몬 샤워젤',12000,15800,'독일','Sante','1360g',50,'자연의 정직함만을 담은 산테의 패밀리 케어는 온 가족을 위한 머리부터 발끝까지의 토탈케어 라인입니다. 비교할 수 없을만큼 산뜻하면서도 식물성 세정성분이 매우 부드러운 피부친화적인 샤워젤입니다. 파파야와 복숭아, 진저향이 매우 향긋한 패밀리형 대용량 사이즈입니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007031000315','E','007','031','E007031000315','마티나겝하르트 릭렉싱 바쓰오일 ',35000,44100,'독일','마티나 겝하르트','100g(35캡슐)',50,'요하니스 열매와 칼렌듈라 성분이 피부 진정을 도와주고 긴장을 완화시켜 줍니다. 입욕시 2~3개의 캡슐을 사용합니다. 캡슐 위로 물을 떨어뜨려 욕조를 채운 수 손으로 잘 풀어줍니다. 캡슐은 순순 식물성으로 만들어？습니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000283','E','010','039','E010039000305','라베라 클리어파잉 토너',5000,9500,'독일','lavera','125ml',50,'지성 및 트러블 피부에 적합한 토너입니다. 유기농 포도 및 은행나무 성분이 함유되어있습니다. 상쾌함과 수렴효과를 느끼실 수 있으며, 피부손상을 개선해주고 윤기있게 가꿔줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010040000306','E','010','040','E010040000306','닥터쉘러 석류 페이셜 클렌징 밀크',5000,11100,'독일','Dr.Scheller','125ml',50,'보습 클렌징 밀크는 특별히 얼굴이나 눈 주위를 부드럽게 클렌징하기 위해 개발된 제품입니다. 피부를 건조하지 않고 부드럽게 클렌징하여 메이크업 잔여 물질을 제거하며, 또한 피부를 탄력있게 가꾸어 줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010040000309','E','010','040','E010040000309','비오텀 클렌징 밀크',12000,17900,'독일','Bioturm ','269g',50,'soap free 로션 타입 클렌져로 부드러운 식물성 성분으로 만들었습니다. 덱스판테놀이 함유되어 손상 피부에도 자극없이 사용할 수 있습니다. 방부제,인공향,파라핀오일,합성색소를 첨가하지 않아 아기들이 사용해도 무난합니다. ',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010040000310','E','010','040','E010040000310','로고나 PUR 극민감성 비누',3000,5800,'독일','logona','120g',50,'독일 알리르기 천식 협회인 DAAD의 테스트에서 인증을 받은 제품입니다. 로고나 퓨터 라인은 순수한 성분으로 민감한 피부를 가지신 분을 위해서 만들어진 라인입니다. 피부 알레르기가 있는 분과 자극에 예민해서 트러블이 잘 생기는 타입인 피부의 특별관리에 좋습니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010040000311','E','010','040','E010040000311','로고나 거품식 세안제 유기농민트&하마멜리스 (복합성)',8000,11700,'독일','logona','180g',50,'클리어 스킨 여드름성, 지성 피부를 위한 라인입니다. 과다유분으로 번질거림과 트러블을 감소시켜 줍니다. 매트하면서도 촉촉하며 모공에 탄력을 더합니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007029000314','E','007','029','E007029000314','라베라 바디스파 허니모먼트 샤워젤',5000,7500,'독일','Lavera','200g',50,'유기농 천연성분이 함유되어 지친 피부의 활력과 보습을 도와주며 천연에센스의 그윽한 향이 편안하고 안락한 기분을 제공합니다. 유기농 유장과 유기농 꿀이 함유되어 피부에 촉촉한 보습을 제공하며 샤워중에도 매우 부드럽고 매끈한 느낌을 받으실 수 있습니다. 또 코코넛 오일과 설탕베이스의 천연 계면활성제가 부드럽고 깔끔한 세정을 도와줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007031000316','E','007','031','E007031000316','타우트로픈 플루이덤 바디스크럽',27000,32300,'독일','타우트로픈','313g',50,'10도 정도의 차가운 청정해역에서만 서식하는 자연 해초는 진정 작용과 피부 청결에 탁월한 효능을 보입니다. 바다소금이 함유되어 부드럽게 각질을 제거해줍니다. 또한 천연 브라운 해조츄의 재생활성 성분이 함유되어 있으며 피부를 깔끔하게 관리해줍니다. ',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007031000317','E','007','031','E007031000317','파팔라 데일리 플레져 샤워 스크럽',12000,16900,'독일','Farfalla','300g',50,'멋지고 부드러운 피부로 가꾸어주는 바디 스크럽입니다. 대나무 유기농 체리, 무화과 추출물이 함유되어 잇어 피부의 균형을 잡아주고 보습을 도와주며 과일 향기가 기분까지 상큼하게 만들어 줍니다. 샤워 시 적？량을 덜어 얼굴을 제외한 전신에 마사지하듯 문지른 후 깨끗이 씻어내세요.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007031000318','E','007','031','E007031000319','파팔라 플라워 바스 목용용 소금 미테',21000,23100,'독일','Farfalla','1000g',50,'최고급 천연 바다 소금이 함유된 목욕용 소금입니다. 천연 에센스 오일과 칼렌듈라 꽃 성분이 함유되어 있어 피부를 더욱 매끈하고 부드럽게 가꾸어 줍니다. 목욕 시 욕조에 3~4클술을 넣고 15~25분간 목욕하세요.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007029000320','E','007','029','E007029000353','네오비오 바이탈리티 샤워젤',3000,4500,'독일','네오비오','500g',50,'순한 설탕 계면 활성제를 사용하여 피부를 자극없이 부드럽고 청결하게 가꾸어 주는 샤워젤입니다. 유기농 오렌지 오일이 함유되어있어 피부를 더욱 상쾌하게 해 줍니다. 물기가 있는 상태에서 샤워젤을 바른 뒤 미온수로 씻어냅니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007028000321','E','007','028','E007028000321','로고나 브렌네셀 영양샴푸',10000,13300,'독일','logona','500ml',50,'유기농 브렌네셀 추출 재생샴푸는 천연오일 구성성분으로 이루어져 있으며, 밀 추출물과 식물성 글리세린을 함유한 샴푸입니다. 자연스럽고 아름다운 머리결이나 부드럽고 손질하기 쉬운 머리결을 원하시는 분은 누구나 사용할 수 있습니다. 값비싼 천연 식물을 원료로 하여 향기롭고 매끈하며 산뜻한 느낌의 머리결을 갖게 도와드립니다. 대용량 패밀리 사이즈입니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007028000322','E','007','028','E007028000322','라베라 로즈밀크 리페어 샴푸',8000,11300,'독일 ','lavera','330g',50,'레시틴과 로즈플라워 워터가 모발을 부드럽고 차분하게 가꿔줍니다. 고급스런 마카다미아 너트오일과 아보카도 오링리 풍부한 영양을 공급해 윤기를 더해주고 모발을 건간하게 유지해줍니다. 갈라진 모발끝과 손상된 모발 회복에 도움을 줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007028000323','E','007','028','E007028000323','세바메드 비듬 샴푸',8000,10400,'독일','sebamed','400g',50,'비듬 샴푸이며 비듬에 효과가 아주 좋은 샴푸입니다. 순해서 지성 두피를 안정시켜 줍니다. 주성분 Piroctone Olamine은 비듬에 확실하며 컨디셔닝 성분이 있어 모발의 건조함을 막아 주며 보습효과가 있습니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007028000324','E','007','028','E007028000324','르네 휘테르 포티샤 샴푸',2000,23700,'프랑스','FURTERER','270g',50,'포티샤 스티뮬레이팅 샴푸는 젤 타입입니다. 샴푸할 때 마사지 하기가 쉽도록 특별히 구성된 제품으로 거품이 풍부하여 두피 마사지를 용이하게 합니다. 두피의 균형을 유지해주고 보호하면서 두피를 정화시켜 줘 모발을 탄력있게 가꿔주고 광택과 힘을 줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007029000328','E','007','029','E007029000328','프라이웰 클렌징 컨셉트 약산성 바디워시',10000,13900,'독일','frei','340g',50,'피부를 촉촉하게 보호하여 세안으로 인한 수분의 손실을 줄여주며, 피부의 노폐물을 깨끗하게 제거 할 수 있도록 도와줍니다. 피부 pH와 동일한 pH-5.5의 약산성 폼 클렌져로 피부에 당김이나 자극없이 피부보호막을 보호해 줍니다. 산모와 아기가 사용해도 좋은 제품입니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007029000329','E','007','029','E007029000329','아벤느 콜드크림 샤워젤',20000,24500,'프랑스','AVENE','250ml',50,'민감하고 매우 건조한 피부를 위한 샤워젤입니다. pH6.5인 제품이며, 가볍고 민감한 피부에도 사용이 가능합니다. 인공 향료를 첨가하지 않았고 38%의 아벤느 온천수를 함유하고 있습니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F004020000338','F','004','020','F004020000338','스위스미스 밀크초콜릿 핫 코코아믹스',5000,6800,'미국','ConAgra','737g',50,'세계적으로 유명한 코코아입니다. 부드럽고 달콤한 맛, 온가족이 함께 할 수 있는 따뜻한 코코아입니다. 밤늦께 까지 공부하는 자녀들을 위해, 가정이나 사무실에서 간편하게 맛있게 드실수있습니다. ',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F001006000339','F','001','006','F001006000339','훈와리메이진 콩가루모찌',3000,3950,'일본','ECHIGOSEIKA CO. LTD.','85g',50,'고소한 콩가루가 가득 묻혀진 콩가루 모찌는 입안에 넣자마자 사르르 녹는듯한 부드러운 느낌이 일품인 과자입니다. 남녀노소 누구나 모두 즐겨먹을 수 있는 제품입니다.',1,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F001002000340','F','001','002','F001002000340','키도 크리미 버터향',600,1000,'필리핀','MONDE NISSIN CORPORATION  ','120g(8개)',50,'동남아 수입비스킷중 최다 판매량으로 많은 인기를 얻고 있는 저렴한 비스킷입니다. 한봉지 안에 8개의 소포장으로 비스켓이 있어 보관에도 편리합니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007028000325','E','007','028','E007028000325','까띠에 프리컨트 유스 요거트샴푸',13000,17500,'프랑스 ','Cattier','400g',50,'까띠에 엑스트라 소프트 샴푸는 밀단백질이 풍부하게 함유되어 모든 타입의 모발에 부드러움과 윤기를 제공합니다. 구성이 가볍고 부드럽고 은은한 거품이 나는 본 제품은 모근에서부터 모발을 강화하고 빗질을 쉽게 해 줍니다. 매우 부드럽고 균형잡힌 pH를 지닌 본 제품은 매일 사용이 가능합니다.',1,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007028000326','E','007','028','E007028000326','파팔라 에브리데이 석류 샴푸',12000,15200,'독일 ','Farfalla','400g',50,'석류성분이 함유되어있어 건조해지기 쉬운 모발에게 수분을 공급해주고 머릿 속 노폐물을 깔끔히 없애주는 샴푸입니다. 정상 모발에 적합하며, 머릿결을 더욱 탄력있게 도와줍니다. ',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007028000327','E','007','028','E007028000327','비오텀 연꽃효과 헤어린스 ',10000,14800,'독일','Bioturm','206g',50,'아기부터 성인까지 온가족이 사용가능합니다. 푸석한 모발을 윤기있게 하고, 탈모현상 집중관리에 사용하시면 좋습니다. 연꽃 효과란? 연꽃잎의 점성성분이 아침이슬이나 빗방울과 함께 오염입자를 밀어내는것을 말합니다. 이런 자연성분으로 머리카락을 보호 코팅하여 머리카락을 더욱 반짝이게 하고 부드럽게 해줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007029000330','E','007','029','E007029000330','까띠에 젤 두쉬 아빠쟝 샤워젤',10000,13600,'프랑스','Cattier','300g',null,'비누 무 첨가 생리학적 pH 제품인 까띠에 바디샴푸는 부드럽게 피부를 닦아주고 피부 표피의 내추럴 밸런스를 유지시켜 줍니다. 미네랄 소금과 필수아미노산이 풍부한 알로에 베라와 피부진정효과가 있는 장미빛점토, 장미 추출수의 결합은 피부를 부드럽게 하고 피부를 재생하며 피부 표피를 정화시켜 줍니다. ',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007029000331','E','007','029','E007029000331','잘링 하트로즈 바쓰 ',5000,6900,'독일','잘링','35g',50,'장미 오일과 장미 잎이 들어있습니다. 양우유와 귀중한 코코아 버터, 부드러운 오일 성분으로 핸드메이드로 만들어진 바스 하트 상품입니다. 어떠한 방부제도 사용하지 않았습니다. 순순한 천연 오일만 사용하였습니다. 목욕시 욕조에 풀어서 사용하세요.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F001003000334','F','001','003','F001003000334','컨츄리쿠키 리치초콜릿',1000,2100,'네덜란드','할레마헬렘사','150g',50,'고소하고 달콤한 맛의 초콜릿 쿠키입니다.초콜릿 작은 덩어리가 쿠키속에 들어있습니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F001003000335','F','001','003','F001003000335','미니볼리에 종합 페스트리',2000,3000,'이태리','비첸지사','250g',50,'독일에서 생산된 고급쿠키입니다. 초코칩쿠키, 크리스피패스트리, 쇼트패스트리 등 다양한 모양과 맛을 냅니다. 부드럽고 고소하고 감미로운 맛이 일품입니다. 맛이 깔끔하고 좋습니다.',1,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
