Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E008033000254','E','008','033','E008033000254','세제 탈부착 수세미',1500,3000,'일본','WAKO','1',50,'입아래 부분이 주방용 세제용기 뚜껑에 끼울 수 있게 홈이 있어 주방용 세제 용기에 부착해 보관할 수 있습니다. 또한 앞뒷면이 표면 밀도가 달라서 거품을 낼 때는 앞면을 찌든때를 세정할 때는 뒷면을 사용하면 용기를 더 효과적으로 세척 할 수 있습니다. (폴리우레탄폼 - 가로10cm,세로15cm,높이 4cm)',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010038000257','E','010','038','E010038000257','실크 테라피',27000,34000,'미국','훠룩시스템','150ml',50,'천연실크를 사용하였고 17개 아미노산을 함유하고 있습니다. 실크아미노산은 모피질안에 침투하여 섬유 조직 강화, 표피 손상 부분을 집중케어하여 탁월한 모발 치료및 재생 효과를 나타냅니다.  ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010038000258','E','007','028','E007028000265','바이오샴푸',60000,79000,'프랑스','파브','1000ml',50,'6가지 아로마오일로 열악한 두피환경을 개선시켜주며, 수분을 더하여 두피를 보호해줍니다. 케라스팀, 비타민B3,B5,B6가 두피를 튼튼하게 해주고, 뿌리,모발,손상을 방지해주며 머리카락이 잘 자랄수 있도록 도와줍니다. 주 향인 백리향은 하루 종일 은은하게 지속됩니다.  ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010038000259','E','007','028','E007028000263','아이덴 프로폴리스 향균샴푸',60000,77000,'미국','e245','946ml',50,'아이덴 두피관리 제품은 무색소, 천연향료 첨가 , 신리콘을 사용하지 않습니다. 예민한 두피를 보호해 주며 모근을 튼튼하게 합니다. 또한 세정력이 좋아서 타 제품의 1/2정도만 사용해주어도 충분한 거품이 생깁니다.2~3분간 마사지 한 후 미온수로 깨끗하게 씻어내십시오.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010037000260','E','010','037','E010037000260','루미나 매직헤어',35000,49000,'일본','아우라','100g',50,'민감한 두치, 피부를 가지신 분이나 알레르기등으로 종전 화학 염색약을 사용하실 수 없던 분들은 염색조차 할 수 없었습니다. 이런 분들은 물론 종전에 염색을 하시던 분들에게 사용이 간편하고 부작용을 최소화한 은이온 감광 발색제인 루미나매직헤어칼라가 주목받고 있습니다. 아침에 샴푸를 하시고 (린스사용금지) 물기를 제거하신뒤 적당양의 루미나를 덜어 빗으로 골고루 빗어주시면 됩니다. ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E007028000266','E','007','028','E007028000266','폴미첼 티트리 스페셜 샴푸',29000,34000,'미국','폴미첼','300ml',50,'하와이안 이와푸이, 카모마일, 헤나, 로즈마리, 알로에 베라의 성분을 가지고 있으며 두치의 치지를 깨끗하게 제거해 청결하게 유지시켜줍니다. 샴푸 시 거품으로 골고루 두피 맛사지 후 1~5분간 방치, 미온수에 헹궈냅니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010037000267','E','010','037','E010037000267','프레쉬라이트 헤어컬러링 염색약',6000,10000,'태국','Schwarzkopf&Henkel','1',50,'얼룩 없는 깨끗한 발색이 되며 8가지 아미노성분으로 모발을 보호합니다. 그리고 기존에 판매되는 염색약과 달리 풋사과& 카시스의 상쾌한 향입니다. 사용하기전에패치테스트를 반드시 해 주시고 파마한 뒤 1주일은 사용하지 마십시오. ',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010037000268','E','010','037','E010037000268','헤어틴트 낱개 ',13000,19000,'미국','1','1',50,'엄지빼고 나머지 손가락으로 틴트를 밭치고 바를 머리카락을 잡아 위에서 아래로 내려주면서 발릅니다. 이때 손에 묻는게 싫다면 얇은 비닐장갑을 끼고 바르거나 엄지손가락에 휴지를 대고 발라주시기바랍니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F005022000269','F','005','022','F005022000269','뉴텔라 초코잼',5000,7600,'독일','nutella','450g',50,'모두가 한번 먹으면 빠져나올수 없다해서 악마의 잼으로 불리는 뉴텔라 잼 입니다. 독일의 온국민이 빵에 발라먹는 대중적인 잼입니다.',1,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F005022000270','F','005','022','F005022000270','뉴텔라&Go! 초콜렛에 찍어먹는 과자',1500,2900,'독일','nutella','100g',50,'바삭한 과자스틱과 너트 누가 크림을 한번에 즐길 수 있는 제품입니다.',0,'admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','admin',to_date('13/06/02','RR/MM/DD'),'14.42.30.224','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000281','E','010','039','E010039000281','로고나 유기농 로즈&알로에 스킨 건성/민감성 피부',10000,14700,'독일','LOGONA','260g',50,'유기농 와일드로즈 오일, 유기농 아몬드, 유기농 살구씨 오일, 알로에 추출물등의 정교한 조합으로 피부 수분을 보충해주고 잔주름을 개선해 주며 피부 성도를 높여 장미빛 혈색을 찾아줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000282','E','010','039','E010039000297','프라이웰 페이스 컨셉트 페이셜토너',12000,17400,'독일','frei','200ml',50,'하마멜리스 성분은 피부를 촉촉하게 유지하는데 도움을 주며, 판테놀성분은 피부각질을 정돈하여 피부를 건강하게 유지하는데 좋습니다. 피부톤은 맑고 투명하게 해주는 고농축 에센스타입 페이셜 토너입니다. 고농축 성분임에도 끈적임 없는 사용감과 빠른 흡수력으로 피부를 부드럽고 편안하게 해 줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000284','E','010','039','E010039000295','라베라 내츄럴 리퀴드 파운데이션',10000,14700,'독일','lavera','30ml',50,'아르간오일과 플라워버터같은 유기농 오일에 함유된 필수 지방산이 수분손실을 방지해 건강하고 빛나보이는 피부표현을 도와줍니다.비타민A,C,E가 함유되어 영양을 공급해 더욱 촉촉합니다. 모든 피부타입에 적합한 식물성 리퀴드 파운데이션입니다. 피부전문가에 의한 검증을 마친 제품이며 콘택트렌즈를 사용하거나 눈이 민감하신 분들이 사용하시기에도 적합한 제품입니다. (색상: 0.1 포셀란 0.2 아이보리 0.3 허니)',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000285','E','010','039','E010039000301','로고나 파운데이션 퍼펙트 피니쉬 ',15000,20400,'독일','Logona','69g',50,'유기농으로 관리,재배한 식물성 오일과 정제된 천연 색소들이 피부에 부담을 주지 않습니다. 또한 피부색을 아름답게 표현해 주는 미세입자가 화장이 들뜨지 않게 해 주며, 촉촉함을 더해주어 하루 종일 편안합니다. 밀착력이 좋은 팩트 파운데이션으로 깔끔한 피부톤을 표현해 줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000286','E','010','039','E010039000296','산테 소프트그림 파운데이션',12000,19900,'독일','sante','85g',50,'부드럽게 발리면서 피부를 밝고 , 고급스럽게 보여주는 파운데이션입니다. 사진은 01번으로 한국인 피부보다 조금 밝은 톤입니다. 파라핀과 실리콘오일이 전혀 포함되지 않은 천연화장품입니다. 유기농 석류 추출물과 호호바 오일성분으로 만들어졌습니다. ',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000287','E','010','039','E010039000294','라베라 2 in 1 컴팩트 파운데이션 0.1베이지',10000,14700,'독일','lavera','73g',50,'파우더와 파운데이션을 한번에 사용하는 제품입니다. 사용이 매우 간편하며 완벽한 보정을 도와주는 컴팩트 파운데이션으로 따로 파우더를 사용할 필요가 없습니다. 크리미한 질감으로 스펀지가 동봉되어 있습니다. 천연안료와 파우더가 포함되어 있어 부드럽고 깔끔한 메이크업을 할 수 있습니다. 미네랄과 비타민이 함유되어 피부를 보호하고 영양을 공급해 줍니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010039000288','E','010','039','E010039000308','베니코스 내츄럴 크리미 메이크업 허니 ',5000,9400,'독일 ','베네코스','80g',50,'번들거림없이 자연스러운 연출을 위한 파운데이션 제품입니다. 유기농 원료 호호바 오일과 쉬어버터의 보습력이 투명하고 촉촉한 피부를 연출할 수 있습니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('E010040000312','E','010','040','E010040000312','로고나 라바에르데 클렌징크림 파츌리',5000,9100,'독일','logona','200ml',50,'피부와 머리카락의 부드러운 세정을 위한 클렌징크림입니다. 계면활성제가 들어있지 않은 피부친화적 미네랄 제품으로 거품은 나지 않습니다. 피부표면 구성이나 pH지수에 전혀 영향을 미치지 않으므로 트러블 피부나 각질이 있고 지성인 두피에 사용하시면 효과가 매우 좋습니다. 사용 후 안색이 맑아지며 촉촉함을 느끼실 수 있습니다.',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F001006000332','F','001','006','F001006000332','쇼우가 츠마이 센베이 쿠키',4000,5000,'일본','Funaoka Seika Co','140g',50,'고소하고 달콤한 맛에 생강이 가미되어 향이 좋습니다. 생강향이 강하지 않아 아이들간식 및 어르신들 간식, 술안주용으로도 좋습니다. ',0,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
Insert into GGADMIN.GOODS (CODE,MAIN_CATEGORY,MIDDLE_CATEGORY,SUB_CATEGORY,GOODS_GROUP,NAME,ORG_PRICE,PAR_PRICE,COUNTRY,COMPANY,QUANTITY,GOODS_AMOUNT,GOODS_COMMENT,GOODS_HIT,REG_ID,REG_DATE,REG_IP,UPD_ID,UPD_DATE,UPD_IP,DISP_YN) values ('F001003000333','F','001','003','F001003000333','그라쩌링게 버터링쿠키',2000,2700,'독일','카페트란체','400g',50,'버터향이 풍부한 부드러운 맛의 고급 버터링 쿠키입니다. 우유와 함께 또는 커피와 함께 곁들여도 좋습니다. 약 16개의 버터링 쿠키가 들어있습니다. ',2,'admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','admin',to_date('13/06/03','RR/MM/DD'),'192.168.0.7','Y');
